import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes } from 'react-router-dom';
import {AddBook} from "./books/addbook";
import {EditBook} from "./books/editbook";
import {BookList} from "./books/booklist";
import {ViewBook} from "./books/viewbook";


function App() {
  return (
    <div className="container">
      <BrowserRouter>
      <nav className="btn btn-warning navbar navbar-expand-lg navheader">
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link to="addbook" className="nav-link">AddBook</Link>
            </li>
            <li className="nav-item">
              <Link to="booklist" className="nav-link">BookList</Link>
            </li>
          </ul>
        </div>
      </nav>

      <Routes>
        <Route exact path="booklist" element={<BookList/>}></Route>
        <Route exact path="addbook" element={<AddBook/>}></Route>
        <Route exact path="viewbook/:id" element={<ViewBook />}></Route>
        <Route exact path="edituser/:id" element={<EditBook />}></Route>
      </Routes>

      </BrowserRouter>
     </div>
  );
}

export default App;
